import React from 'react'

const Stories = () => {
  return (
    <div>
        <h1 style={{fontSize:"60px",marginTop:"85px"}}>Victory Stories</h1>
    <p style={{width:"60%",margin:"auto",marginTop}}>When you reach your goals, our whole community celebrates with you. That’s over 200 million members sharing in your victory—using it to inspire their own journey.</p>
    </div>
  )
}

export default Stories
